import GetLocation from "./getLocation";
import React, {useState} from "react";

export default function InsuRequest(){
    const [data, setData] = useState([]);
    const [name, setName] = useState('');
    const onClickSearch = (e : React.MouseEvent) => {
        
    }
    return(
        <div className='w-full'>
                <div className='div_wrap flex_center'>
                    <div className='my-8 w-full flex_center'>
                        <div className='flex items-center w-[450px] border h-[50px]'>
                            <div
                                className='px-6 text-black text-[16px] font-[500] h-full flex items-center border-r basis-1/3'>
                                주차장명
                            </div>
                            <input type='text' className='search_input' onChange={(e:React.ChangeEvent<HTMLInputElement>) => setName(e.currentTarget.value)}/>
                            <div
                                className=' text-black text-[16px] font-[500] h-full flex_center border-r basis-1/3'>
                                <button className='w-full h-full text-white bg_base hover:text-[#FFD840]' onClick={onClickSearch}>
                                    SEARCH
                                </button>
                            </div>
                        </div>
                        <GetLocation data={data}/>
                    </div>
                </div>
        </div>
    )
}
